import React from 'react'
import { createContext } from 'react'
import Main from './Main'

const Properties = createContext()

const App = () => {


  return (
   
    <div className='app'>
       <Properties.Provider value={'Muhammad Adil'}>
        <Main/>
       </Properties.Provider>
    </div>
  )
}

export default App
export {Properties};
